INSERT INTO [[schema]].psea_indicator VALUES (1, '2019-10-04 17:30:17.734439+00', '2019-10-04 17:30:17.734456+00', 'Core Standard 1: Organizational Policy', 'An organizational policy exists and is signed by all personnel (see:<a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B42E6DD24-5001-42C8-9050-B4ACAD0C4289%7D&file=PSEA%20Toolkit%20Field%20Tested%20Draft%20July%2022%202019.docx&action=default&mobileredirect=true&cid=7aa0aeea-cb8e-489c-89bd-2e6e77316cdc"> PSEA</a> Toolkit Section 4.2.1. Policies). (Note that the policy may exist as part of a code of conduct and/or a comprehensive SEA policy.)<ul><li>Criteria 1: Organizational policy includes: <ul><li>a) a definition of SEA (that is aligned with the <a href="https://undocs.org/ST/SGB/2003/13">UN''s definition</a>);</li><li>b) a description of behavior expected of personnel on- and off-duty (reflecting the <a href="https://interagencystandingcommittee.org/principals/documents-public/iasc-six-core-principles-relating-sexual-exploitation-and-abuse-2002">IASCs Six Core Principles Relating to SEA</a>); </li><li>and c) an explicit statement of zero-tolerance for SEA (i.e. SEA as a ground for disciplinary actions, which may result in termination of employment).</li></ul></li><li>Criteria 2: The organizational policy on PSEA (e.g. code of conduct) is signed by all personnel, including employees, volunteers, contractors, and others.</li><li>Criteria 3: The organization displays information on PSEA policy and procedure, including the code of conduct and reporting channel details, in its own offices and at project sites.</li></ul>', true, 1, '');
INSERT INTO [[schema]].psea_indicator VALUES (2, '2019-10-04 17:30:17.772602+00', '2019-10-04 17:30:17.772621+00', 'Core Standard 2: Organizational Management and HR Systems', 'The organizations management and HR systems account for PSEA (see : <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B42E6DD24-5001-42C8-9050-B4ACAD0C4289%7D&file=PSEA%20Toolkit%20Field%20Tested%20Draft%20July%2022%202019.docx&action=default&mobileredirect=true&cid=7aa0aeea-cb8e-489c-89bd-2e6e77316cdc">PSEA Toolkit</a> Section 4.2.2. Procedures).<ul><li>Criteria 1: The organization defines roles and responsibilities of personnel with specific PSEA-related responsibilities in their contracts and/or ToR. </li><li>Criteria 2: The organizations contracts and partnership agreements include a standard clause requiring contractors, suppliers, consultants and sub-partners to commit to a zero-tolerance policy on SEA and to take measures to prevent and respond to SEA.</li><li>Criteria 3: There is a systematic vetting procedure in place for job candidates (e.g. reference checks, police records, Google searches) in accordance with local laws regarding employment, privacy and data protection, including checking for prior involvement in SEA or other safeguarding concerns.</li></ul>', true, 2, '');
INSERT INTO [[schema]].psea_indicator VALUES (3, '2019-10-04 17:30:17.805284+00', '2019-10-04 17:30:17.805305+00', 'Core Standard 3: Mandatory Training', 'The organization holds mandatory trainings for personnel on the organizations SEA policy and procedures (see : <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B42E6DD24-5001-42C8-9050-B4ACAD0C4289%7D&file=PSEA%20Toolkit%20Field%20Tested%20Draft%20July%2022%202019.docx&action=default&mobileredirect=true&cid=7aa0aeea-cb8e-489c-89bd-2e6e77316cdc">PSEA Toolkit</a> Section 4.3.1. Training). (Note this training can be delivered online or in-person.)<ul><li>Criteria 1: The organization has a plan for training all personnel on PSEA.</li><li>Criteria 2: The training includes <ul><li>1) a definition of SEA (that is aligned with the <a href="https://undocs.org/ST/SGB/2003/13">UN''s definition</a>);</li><li>2) a prohibition of SEA; </li><li>and 3) actions that personnel are required to take (i.e. prompt reporting of allegations and referral of survivors).</li></ul></li><li>Criteria 3: The organization requires all personnel to participate in its PSEA training and retains an internal record of attendance (i.e. name of trainees, date of training, type of training, training provider).</li></ul>', true, 3, '');
INSERT INTO [[schema]].psea_indicator VALUES (4, '2019-10-04 17:30:17.838738+00', '2019-10-04 17:30:17.838757+00', 'Core Standard 4: Reporting', 'The organization has mechanisms and procedures for personnel, beneficiaries and communities, including children, to report SEA allegations that comply with core standards for reporting (i.e. safety, confidentiality, transparency, accessibility) and ensures that beneficiaries are aware of these (see <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B42E6DD24-5001-42C8-9050-B4ACAD0C4289%7D&file=PSEA%20Toolkit%20Field%20Tested%20Draft%20July%2022%202019.docx&action=default&mobileredirect=true&cid=7aa0aeea-cb8e-489c-89bd-2e6e77316cdc">PSEA Toolkit</a> Section 4.3.2. Awareness-raising and Section 5.2. Reporting Mechanisms).<ul><li>Criteria 1: The organization has communication materials on PSEA and reporting channels available in locally relevant languages and presented in a way that all groups, including children, understand. </li><li>Criteria 2: The organization has a description of how personnel and beneficiaries can report SEA allegations and the organizations procedures for handling these allegations, including those involving personnel of other entities. </li><li>Criteria 3: The organization limits the number of people with access to reported information and removes identifying information of those involved when sharing information.</li></ul>', true, 4, '');
INSERT INTO [[schema]].psea_indicator VALUES (5, '2019-10-04 17:30:17.871607+00', '2019-10-04 17:30:17.871626+00', 'Core Standard 5: Assistance and Referrals', 'The organization has a system to ensure survivors of SEA, including children, receive immediate professional assistance, referring them to relevant service providers (see <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B42E6DD24-5001-42C8-9050-B4ACAD0C4289%7D&file=PSEA%20Toolkit%20Field%20Tested%20Draft%20July%2022%202019.docx&action=default&mobileredirect=true&cid=7aa0aeea-cb8e-489c-89bd-2e6e77316cdc">PSEA Toolkit</a> Section 6.2. Assistance and Referrals).<ul><li>Criteria 1: The organization has an updated list of local service providers and/or contact with local GBV coordination mechanisms (i.e. GBV sub-cluster) for all programme sites/areas.</li><li>Criteria 2: The organization has a procedure to guide the referral process, outlining the steps that personnel, particularly those receiving complaints, need to take, including follow-up to referrals.</li><li>Criteria 3: The organization has a referral form for survivors of GBV/SEA.</li></ul>', true, 5, '');
INSERT INTO [[schema]].psea_indicator VALUES (6, '2019-10-04 17:30:17.904569+00', '2019-10-04 17:30:17.90459+00', 'Core Standard 6: Investigations', 'The organization has a process and plan for ensuring investigation into SEA allegations involving its personnel (see <a href="https://unicef.sharepoint.com/:w:/r/sites/DAPM/_layouts/15/Doc.aspx?sourcedoc=%7B42E6DD24-5001-42C8-9050-B4ACAD0C4289%7D&file=PSEA%20Toolkit%20Field%20Tested%20Draft%20July%2022%202019.docx&action=default&mobileredirect=true&cid=7aa0aeea-cb8e-489c-89bd-2e6e77316cdc">PSEA Toolkit</a> Section 7.2. Investigation Procedures).<ul><li>Criteria 1: The organization has a process for reviewing allegations of SEA and deciding on the need for investigation and other next steps (e.g. assistance for adult/child survivors and/or others, need for investigation); this involves a system for recording all SEA allegations involving its personnel and its response measures. </li><li>Criteria 2: The organization has access to an experienced, impartial and trained investigator to conduct an investigation on SEA; this may involve using in-house capacity, hiring an external investigator, or getting a commitment of partner(s) for support.</li><li>Criteria 3: The organization has a system for providing organizational oversight of an investigation (e.g. information-sharing/communications, risk assessments), including disciplinary measures in case of substantiated allegations.</li></ul>', true, 6, '');


